// App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Dashboard from './pages/Dashboard';
import Usuario from './';
//import Roles from './pages/Roles';
//import Permisos from './pages/Permisos';

function App() {
  return (
    <Router>
      <Routes>
        {/* Ruta principal redirige al dashboard */}
        <Route path="/" element={<Navigate to="/seguridad" replace />} />

        {/* Rutas del Dashboard */}
        <Route path="/seguridad" element={<Dashboard />}>
          {/* Ruta principal de seguridad */}
          <Route index element={<div>Bienvenido a Seguridad</div>} />

          {/* Subrutas de seguridad */}
          <Route path="usuarios" element={<Usuario />} />


          {/* Redirecciones para manejar URLs con may√∫sculas */}
          <Route path="Usuarios" element={<Navigate to="/seguridad/usuarios" replace />} />

        </Route>

        {/* Ruta para manejar URLs no encontradas */}
        <Route path="*" element={<Navigate to="/seguridad" replace />} />
      </Routes>
    </Router>
  );
}

export default App;
